import React, { useState } from 'react';
import "./ClientAuth.css";

const ClientAuth = () => {

    const [client_auth_form_toggle, setClient_auth_form_toggle] = useState("False");

    return (
        <form className='Client_Auth_Form'>
            <div className='Client_Auth_Form_Header'>
                <h3>Login Here</h3>
                <button></button>
            </div>

            <label for="username">Full Name</label>
            <input type="text" placeholder="Email or Phone" id="username"/>

            <label for="username">Email Address</label>
            <input type="text" placeholder="Email or Phone" id="username"/>

            <label for="password">Password</label>
            <input type="password" placeholder="Password" id="password"/>

            <button>Log In</button>
            <div className="social_container">
                <button className="btn btn_primary"><i className="fa fa-google"></i>  Google</button>
                <button className="btn btn_secondary"><i className="fa fa-facebook"></i>  Facebook</button>
            </div>
        </form>
    );
}

export default ClientAuth;
